function grabPublicationListComplete(a) {
    a = a.responseText.split("---");
    searchBoxList.pages_searchbox.addField(structureInfo.pages.fields["publication name"], "Publication", "s", a);
    searchBoxList.pages_searchbox.addField(structureInfo.pages.fields["publication name"], "Publication Name", "a");
    searchBoxList.pages_searchbox.addField(structureInfo.pages.fields.section, "Section", "a");
    searchBoxList.pages_searchbox.addField(structureInfo.pages.fields["page no"], "Page No", "i")
}

function mainGrabPublicationListComplete(a) {
    a = a.responseText.split("---");
    for (var b = document.addmultipleitemsform.publication, c = 0; c < a.length; c++) b.appendChild(Builder.node("option", a[c].split("&nbsp;").join(" ")));
    searchBoxList.flavouredgroups_searchbox.addField(structureInfo.link.fields.publication, "Publication", "s", a)
}

function initNavTabs() {
    if (!sessionInfo.supplierSignOffMode && !sessionInfo.flightMode) switch ($("mydetailstab").style.display = sessionInfo.canViewContactDetails ? "block" : "none", sessionInfo.uiMode) {
        case "main":
            $("logostab").style.display = databaseInfo.allTabs || sessionInfo.regularShowLogosTab ? "block" : "none";
            $("imagestab").style.display = databaseInfo.allTabs || sessionInfo.regularShowImagesTab ? "block" : "none";
            $("pricestab").style.display = databaseInfo.allTabs || sessionInfo.regularShowPricesTab && databaseInfo.showPricesTab ?
                "block" : "none";
            $("producttexttab").style.display = databaseInfo.allTabs || sessionInfo.regularShowProductTextTab ? "block" : "none";
            $("pagestab").style.display = databaseInfo.allTabs || sessionInfo.regularShowPagesTab ? "block" : "none";
            $("sectionstab").style.display = databaseInfo.allTabs || sessionInfo.regularShowSectionsTab ? "block" : "none";
            $("publicationstab").style.display = databaseInfo.allTabs || sessionInfo.regularShowPublicationsTab ? "block" : "none";
            $("planningtab").style.display = databaseInfo.allTabs || sessionInfo.regularShowPlanningTab ?
                "block" : "none";
            $("checkedouttab").style.display = databaseInfo.allTabs || sessionInfo.enableWebPlugin ? "block" : "none";
            break;
        case "basic":
            $("logostab").style.display = databaseInfo.allTabs || sessionInfo.basicLogos ? "block" : "none", $("imagestab").style.display = databaseInfo.allTabs || sessionInfo.basicImages ? "block" : "none", $("producttexttab").style.display = "none", $("pagestab").style.display = databaseInfo.allTabs || sessionInfo.basicPages ? "block" : "none", $("sectionstab").style.display = "none", $("publicationstab").style.display =
                "none"
    }
}

function changeColor(a) {
    var b = Math.floor(a * 255);
    document.getElementById("recordgridcontainer").style.backgroundColor = "rgb(" + b + "," + b + "," + b + ")";
    a < 0.5 ? setCSSClassAttribute(".recordgridcell", "color", "#fff") : setCSSClassAttribute(".recordgridcell", "color", "#000")
}

